use videogame_data;

DROP TABLE IF EXISTS game_names;

CREATE TABLE game_names 
(
    game_id	INT,
    game_name	VARCHAR(512)
);

    
SELECT * FROM game_names LIMIT 10;



DROP TABLE IF EXISTS reviews;


CREATE TABLE reviews 
(
    review_id	INT,
    game_id	INT,
    critic_score	DECIMAL(3,1),
    user_score	DECIMAL(3,1)
);

    
    
SELECT * FROM reviews LIMIT 10;


DROP TABLE IF EXISTS sales;


CREATE TABLE sales 
(
    sale_id	INT,
    game_id	INT,
    platform	VARCHAR(512),
    publisher	VARCHAR(512),
    developer	VARCHAR(512),
    games_sold	DECIMAL(4,2),
    years	INT
);

    
    
SELECT * FROM sales LIMIT 10;



